import { useLocation } from "react-router-dom";

import { Document, Page } from "react-pdf";

function Flipbook() {
  const location = useLocation();
  const pdfUrl = decodeURIComponent(new URLSearchParams(location.search).get("pdf"));

  return (
    <div>
      <h1>PDF Viewer</h1>
      <p>PDF URL: {pdfUrl}</p>

      <Document
        file={pdfUrl}
        onLoadError={(error) => console.error("PDF Load Error:", error)}
      >
        <Page pageNumber={1} />
      </Document>
    </div>
  );
}

export default Flipbook;
